        n[i] += [nMath, nGreedy, nGeometry][i] + [nDP, nGraph, nOther][i]
    ans = 0
    for i in range(3):
        if n[i] >= 3:
            f[i] = 1
        ans += n[i] // 3
        n[i] %= 3
        k[n[i]] += 1
    if k[0] > 0:
        if k[2] == 2:
            i = 0
            while n[i]:
                i += 1
            if f[i]:
                ans += 1
    elif k[1] > 0:
        ans += 1
    elif k[2] > 0:
        ans += 2
    return ans

